import React from "react";
import { Form, Button, Row, Col, Card, Input, DatePicker, TimePicker } from 'antd';

export default function TrackingSheet() {

    const onFinish = (values) => {
        console.log(values);
    };

    const onChange = (date, dateString)  => {
        console.log(date, dateString);
    }

    return (
        <>
            <Card bordered={false} style={{ width: '100%', marginBottom: '5px' }}>
                <div className="max-w-580-px mx-auto">
                        <strong>Stage Tracking</strong>
                        <br></br>
                        For active pulse processing the Stage Start, End and Pre & Post Frac pulse times must be entered into the Stage sheet before one attempts to process active pulses in the NF app. If not entered the app will not function.
                </div>
            </Card>
            <Card>
                <Form
                    name="dynamic_form_nest_item"
                    onFinish={onFinish}
                    autoComplete="off"
                >
                    <Row gutter={24}>
                        <Col span={8}>
                            <Form.Item
                                name={'date'}
                                label="Date"
                            >
                                <DatePicker onChange={onChange} className="w-full"/>
                            </Form.Item>
                        </Col>
                        <Col span={8}>
                            <Form.Item
                                name={'customer'}
                                label="Customer"
                            >
                                <DatePicker onChange={onChange} className="w-full"/>
                            </Form.Item>
                        </Col>
                        <Col span={8}>
                            <Form.Item
                                name={'well'}
                                label="Well"
                            >
                                <Input className="w-full"/>
                            </Form.Item>
                        </Col>
                    </Row>
                </Form>
            </Card>
        </>
    );
}
